import { useState, useEffect } from 'react';
import Blogs from './components/Blogs';

const App = () => {

  const blogs = [
    {
      title: "test",
      author: "test",
      url: "test",
      likes: "1"
    },
    {
      title: "test",
      author: "test",
      url: "test",
      likes: "2"
    },
    {
      title: "test",
      author: "test",
      url: "test",
      likes: "3"
    }
  ]

  const blogit = blogs.map(blog => blog.title)

  const Title = (props) => {
    <p>{props.blogit}</p>
  }

  return (
    <div className="App">
      <h1>Blogs</h1>
      <Title />
      <Blogs />
    </div>
  );
}

export default App
